import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
	render() {
		return (
			<div className="bx">
				<header>
					<h1>Live Cryptocurrency</h1>
					<p className="countdown"></p>
					<button className="btn_reload">
						<span className="blind">Refresh</span>
					</button>
				</header>
			</div>
		);
	}
}

export default App;
